import React from "react";
import MyCard from "./Card.js";

function printItem(text, index) {
    return <MyCard value={text} click={move} key={index} />;
}

function move(event) {
    console.log(event);
}


function List(props) {
    function printItem(text, index) {
        return <MyCard value={text} click={move} key={index} />;
    }
    return props.list.map((item, i) =>
        printItem(item, i));

}
export default List;
